CREATE TABLE employees (
	emp_id INT,
	last_name VARCHAR(50) NOT NULL,
	first_name VARCHAR(50) NOT NULL,
    middle_name VARCHAR(50),
	email VARCHAR(50),
	hire_date DATE,
	department VARCHAR(20),
	gender ENUM('M', 'F'),
	salary INT,
	state_id INT,
	PRIMARY KEY(emp_id),
